import { Box, Typography } from '@mui/material'
import React from 'react'

const EmojiPicker = (props) => {
    return (
        <Box>
            <Typography variant='h3' fontWeight="700" sx={{ cursor: "pointer" }}>
                {props.icon}
            </Typography>

        </Box>
    )
}

export default EmojiPicker
